const query=getUrlParameter("id");const siteTitle=document.getElementById("siteTitle");var ezCast;getEZCasts();function onEZCastsLoaded(b){for(var a=0;a<b.length;a++){if(b[a]._id==query){ezCast=b[a]}}siteTitle.innerHTML=ezCast.name}function getUrlParameter(a){a=a.replace(/[\[]/,"\\[").replace(/[\]]/,"\\]");var c=new RegExp("[\\?&]"+a+"=([^&#]*)");var b=c.exec(location.search);return b===null?"":decodeURIComponent(b[1].replace(/\+/g," "))};